kerncraft version: 0.8.15
model name: Intel(R) Xeon(R) Platinum 8360Y CPU @ 2.40GHz
model type: Intel Icelake SP processor
clock: 2.4 GHz

sockets: 2
cores per socket: 36
threads per core: 1
NUMA domains per socket: 2
cores per NUMA domain: 18
transparent hugepage: always

in-core model: !!omap
  - OSACA: ICX
  - IACA: SKX  # IACA does not support anything newer than SKX, which is similar to CLX
  - LLVM-MCA: -mcpu=icelake
isa: x86

FLOPs per cycle:
  DP: {ADD: 16, FMA: 32, MUL: 16, total: 32}
  SP: {ADD: 32, FMA: 64, MUL: 32, total: 64}

compiler: !!omap
- icc: -O3 -fno-alias -xCORE-AVX512 -qopenmp -qopt-zmm-usage=high -ffreestanding -nolib-inline
- clang: -O3 -march=icelake-server -D_POSIX_C_SOURCE=200112L -fopenmp -ffreestanding
- gcc: -O3 -march=icelake-server -fopenmp -ffreestanding


# gcc --target-help -march=foo lists all supported march

non-overlapping model:
  ports:
    IACA: [2D, 3D]
    OSACA: [2D, 3D]
    LLVM-MCA: [SKXPort2, SKXPort3]
  performance counter metric: T_OL + T_L2 + T_L3 + T_MEM
overlapping model:
